import createReactComponent from '../createReactComponent';
var Map = createReactComponent('Map', [['polygon', {
  points: '1 6 1 22 8 18 16 22 23 18 23 2 16 6 8 2 1 6',
  key: 'kc6v1j'
}], ['line', {
  x1: '8',
  y1: '2',
  x2: '8',
  y2: '18',
  key: 'bztekw'
}], ['line', {
  x1: '16',
  y1: '6',
  x2: '16',
  y2: '22',
  key: '10bda6'
}]]);
export default Map;
